import React from 'react';
import { Link } from "react-router-dom";
const Header = () => {
    return (
        <ul>
            <li>
                <Link to='/'> Home</Link>
            </li>
            <li>
                <Link to='/catalog' >Catalog</Link>
            </li>
            <li>
                <Link to='/about'>About</Link>
            </li>
        </ul>
    )
}
export default Header;
